import './App.css';
import "./Components/Base/AppBar/AppBar"; //vamos a importar el componente AppBar
import AppBar from './Components/Base/AppBar/AppBar';
import TimeBar from "./Components/Base/AppBar/TimeBar"

function App() {
  return (
    <div className="App">
      <AppBar
      //pasar los props del componente AppBar:
      title="Mi primera App"
      subtitle="Ya funciona wuu"   
      tiempo= {<TimeBar />}  //pasamos el componente de TimeBar como prop de tiempo (que viene del componente AppBar)
     />

      <AppBar
      //volvemos a usar el mismo componente, mismas propiedades pero diferente info
      title="Mi Segunda App"
      subtitle="Ya funciona tambien eaeaea"
      //acá no incluimos el componente del tiempo por lo que ni lo incluimos 
      />

    </div>



  );
}

export default App;
